function I = fcnK7C(S, t, u, alpha, F, tol)
t1 = F .^ 2;t2 = 0.1e1 ./ S;t6 = sqrt(S .* t1 + u);t7 = 0.1e1 ./ t6;t9 = S .^ 2;t17 = alpha .^ 2;t18 = S .* alpha;t19 = -t18 + u;t20 = 0.1e1 ./ t19;t21 = t20 .* t17;t22 = sqrt(-alpha);t23 = F - t22;t24 = t23 .^ 2;t26 = t22 .* S;t27 = t23 .* t26;t30 = sqrt(t24 .* S - t18 + 0.2e1 .* t27 + u);t31 = 0.1e1 ./ t30;t34 = t22 .* t17;t35 = t20 .* t34;t36 = 0.1e1 ./ u;t38 = F .* S;t42 = sqrt(t19);t45 = 0.1e1 ./ t42 ./ t19 .* t17;t48 = 0.1e1 ./ t23;t50 = log(0.2e1 .* t48 .* (t30 .* t42 - t18 + t27 + u));t53 = F + t22;t54 = t53 .^ 2;t56 = t53 .* t26;t59 = sqrt(t54 .* S - t18 - 0.2e1 .* t56 + u);t60 = 0.1e1 ./ t59;t69 = 0.1e1 ./ t53;t71 = log(0.2e1 .* t69 .* (t59 .* t42 - t18 - t56 + u));t78 = t17 .* alpha;t79 = S .* t78;t80 = t19 .^ 2;t81 = 0.1e1 ./ t80;t86 = t9 .* t78 .* t22;t87 = t36 .* t81;t93 = 0.1e1 ./ t42 ./ t80;t111 = t7 .* t2 .* t1 + 0.2e1 .* t7 ./ t9 .* u + 0.2e1 .* t7 .* t2 .* alpha + 0.3e1 ./ 0.2e1 .* t31 .* t21 - 0.2e1 .* t38 .* t31 .* t36 .* t35 - 0.3e1 ./ 0.2e1 .* t50 .* t45 + 0.3e1 ./ 0.2e1 .* t21 .* t60 + 0.2e1 .* t38 .* t60 .* t36 .* t35 - 0.3e1 ./ 0.2e1 .* t71 .* t45 - t31 .* t48 .* t20 .* t34 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t31 .* t81 .* t79 - 0.3e1 ./ 0.4e1 .* F .* t31 .* t87 .* t86 - 0.3e1 ./ 0.4e1 .* t50 .* t93 .* t79 + t60 .* t69 .* t20 .* t34 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t60 .* t81 .* t79 + 0.3e1 ./ 0.4e1 .* F .* t60 .* t87 .* t86 - 0.3e1 ./ 0.4e1 .* t71 .* t93 .* t79;
I = t111(:,:,2) - t111(:,:,1);

end
